import React from 'react';
import {getAllClinics} from "./Clinics Functions/ClinicsFunctions";
import ClinicCard from "./ClinicCard";

const ClinicsTable = ({clinics}) => {

    if (clinics.length === 0) {
        return <div className="clinicTable">
            <h2 className={"no-clinics"}>Please add clinics</h2>
        </div>
    }


    return (
        <div className="clinicTable">

            {
                clinics.map(clinic => {
                    return <ClinicCard key={clinic.id} clinic={clinic}/>
                })
            }

            {/*<button className="btn-secondary"*/}
            {/*        onClick={() => editClinic(clinic.id)}>edit*/}
            {/*</button>*/}

            {/*<button className="btn-danger"*/}
            {/*        onClick={() => deleteClinicMethod(clinic.id)}>delete*/}
            {/*</button>*/}

        </div>
    );
};

export default ClinicsTable;
